 pragma solidity ^0.8.17;
library SafeMath {
    
    function add(uint256 a, uint256 b) internal pure returns (uint256) {
        uint256 c = a + b;
        require(c >= a, "SafeMath: addition overflow");
        return c;
    }
    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b <= a, "SafeMath: subtraction overflow");
        uint256 c = a - b;
        return c;
    }
    function mul(uint256 a, uint256 b) internal pure returns (uint256) {
       if (a == 0) {
            return 0;
        }
        uint256 c = a * b;
        require(c / a == b, "SafeMath: multiplication overflow");
        return c;
    }
    function div(uint256 a, uint256 b) internal pure returns (uint256) {
        // Solidity only automatically asserts when dividing by 0
        require(b > 0, "SafeMath: division by zero");
        uint256 c = a / b;
        // assert(a == b * c + a % b); // There is no case in which this doesn't hold

        return c;
    }
    function mod(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b != 0, "SafeMath: modulo by zero");
        return a % b;
    }
}

interface IERC20 {
    // function transfer(address to, uint256 value) external returns (bool);
    function transferFrom(address from, address to, uint256 value) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}
interface IRERC20 {
    function transfer(address to, uint256 value) external returns (bool);
    // function transferFrom(address from, address to, uint256 value) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

contract ContractB {
    using SafeMath for uint256;
    IERC20 public tokenA;
    IRERC20 public tokenC;
    
    constructor(address _tokenA, address _tokenC)  {
        tokenA = IERC20(_tokenA);
        tokenC = IRERC20(_tokenC);
    }

    function transferTokenBalance(  uint256 _amount) external {
    tokenA.transferFrom(msg.sender , address(this), _amount);
    // tokenC.transfer(address());
    
 }
//     function DirectSend(address _to,  uint256 _amount) external {
//     // tokenA.transferFrom(msg.sender , address(this), _amount);
//     tokenC.transfer(_to , _amount);
//  }
}

